import React from "react";
import axios from "axios";
import { useParams } from "react-router-dom";

const Search = () => {
  const movies = useParams();
  React.useEffect(() => {
    axios
      .get(`/movies/search/${movies}`)
      .then((movie) => console.log(movie))
      .catch((err) => err);
  });
  return <></>;
};

export default Search;
